import ProyectoContext from "../../context/proyectos/ProyectoContext";

const Proyecto = ( { proyecto } ) => {
  return (
    <li>
      <button
        type="button"
        className="btn btn-blank"
      >
        { proyecto.nombre }
      </button>
    </li>
  );
}

export default Proyecto;
